import React from 'react';
import s from './Cards.module.css';
import Card from '../Card/Card';
import { CSSTransition } from 'react-transition-group';

export default function Cards({selected, render}) {

    return (
    <div className={s.cards}>
        {
        (render?.map((p,index) =>(
            <CSSTransition
            in={true}
            timeout={index*10}
            appear={true}
            key={p.id}
            classNames={{
              appear: s.MyClassEnterActive,
              enterDone: s.MyClassEnterDone,
              exitActive: s.MyClassExit,
              exitDone: s.MyClassExitActive
            }}>
                <Card name={p.name} id={p.id} key={p.id} selected={selected} />
            </CSSTransition>
        )))
        }

    </div>
        )
    };
